import React, { useState } from "react";

function ParameterSlider({ label, param, min, max, onChange }) {
  const [value, setValue] = useState((min + max) / 2);

  return (
    <div style={{ margin: "15px 0" }}>
      <label>{label}</label>
      <input
        type="range"
        min={min}
        max={max}
      />
    </div>
  );
}

export default ParameterSlider;
